                    <a
                      class="nav-link active para"
                      data-bs-toggle="tab"
                      href="#dashboard"
                    >
                      <i class="fa fa-pie-chart  text-gold"></i>&nbsp;Dashboard
                    </a>
                  </li>
                  <li class="nav-item">
                    <a
                      class="nav-link para"
                      data-bs-toggle="tab"
